import React from "react";
import Link from "next/Link";

export default function AboutPage() {
  console.log("*****************About Component*******************");
  return (
    <div>
      <h1>About Page</h1>
      <Link href="/contact">
        <a>Contact</a>
      </Link>
      <Link href="/">
        <a>Index</a>
      </Link>
    </div>
  );
}
